import phone from '../../public/images/категории/smartphone_smart.svg';
import tablet from '../../public/images/категории/tabletchart_118080.svg';
import audio from '../../public/images/категории/Speaker_icon.svg';
import access from '../../public/images/категории/Office_-22.svg';
import laptop from '../../public/images/категории/32officeicons.svg';
const categories = [
{
    name: 'Телефоны',
    img: phone
},
{
    name: 'Планшеты',
    img: tablet
},
{
    name: 'Аудио',
    img: audio
},
{
    name: 'Аксессуары',
    img: access
},
{
    name: 'Ноутбуки',
    img: laptop
},
];
export default categories;
